import wave from "../../assets/wave.png"

export default function WaveHeightDirection({ waveHeight, currentDirection }) {
    const waveH = [];
    const waveD =[];

    for (let i = 0; i < waveHeight.length; i++) {
        let obj = { heigth: waveHeight[i] }
        waveH.push(obj);
    }
    for (let i = 0; i < currentDirection.length; i++) {
        let obj = { heigth: currentDirection[i] }
        waveH.push(obj);
    }
    return (
        <Content>
            {waveH.map((value, index) => (
                <WHeight
                key={index}
                heigth={value.heigth}
                />
            ))}

        </Content>
    )
}

function WHeight({heigth}){
    return(
<>{heigth}</>
    )
}

const Content = styled.div`
